import{_ as e,o as t,c as o,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 10.1-2119 Effect of chapter on other governmental authority.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/10.1-2119.md","filePath":"vacode/10.1-2119.md"}'),r={name:"vacode/10.1-2119.md"},n=a('<h1 id="§-10-1-2119-effect-of-chapter-on-other-governmental-authority" tabindex="-1">§ 10.1-2119 Effect of chapter on other governmental authority. <a class="header-anchor" href="#§-10-1-2119-effect-of-chapter-on-other-governmental-authority" aria-label="Permalink to &quot;§ 10.1-2119 Effect of chapter on other governmental authority.&quot;">​</a></h1><p>The authorities and powers granted by the provisions of this chapter are supplemental to other state and local governmental authority and do not limit in any way other water quality restoration, protection and enhancement authority of any agency or local government of the Commonwealth. All counties, cities and towns are authorized to exercise their police and zoning powers to protect the quality of state waters from nonpoint source pollution as provided in this Code.</p><p>1997, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0021" target="_blank" rel="noreferrer">21</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0625" target="_blank" rel="noreferrer">625</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0626" target="_blank" rel="noreferrer">626</a>.</p>',3),i=[n];function c(l,h,s,f,p,_){return t(),o("div",null,i)}const u=e(r,[["render",c]]);export{g as __pageData,u as default};
